import React, {useState} from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

function Register(props){
    
    const navigation = useNavigate();

    const [userData, setUserData] = useState(
        {
            username: "",
            password: ""
        }
    );

    function handleOnChange(event){
        const target = event.target;
        setUserData((prev)=>{
            return (
                {
                    ...prev,
                    [target.name]: target.value
                }
            )
        });
    }

    async function handleOnClick(){
        const url = props.SERVER_API + "/register";
        const data = {username: userData.username , password: userData.password};
        const response = await axios.post(url, data, {headers: {'content-type': 'application/x-www-form-urlencoded'}});
        if(response.data === "exists"){
            alert("This user already exists please log in");
        }else{
            
        }
    }

    return (
        <div>
            <h1>Register</h1>
            <input onChange={handleOnChange} type="text" placeholder="Username" name="username"/>
            <input onChange={handleOnChange} type="password" placeholder="Password" name="password"/>
            <button onClick={handleOnClick}>Register</button>
        </div>
    )
}

export default Register;
